import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Button from 'react-bootstrap/Button';
import {
  Link
} from 'react-router-dom';

class JumboLogin extends React.Component {
  render() {
    return (
      <Jumbotron fluid className="jumbo-padding">
        <div className="container-fluid">
          <div className="row">
            <div className="col-sm custom-jumbo">
              <Link className="navbar-brand" href="#home" to="/home">
                  <img className="custom-nav-logo"
                  src="logohero.png"
                  alt="StatHero Logo"
                  width="105px"
                  height="50px" />
              </Link>
            </div>
            <div className="col-sm custom-jumbo2">
              <img
                src={require("/Users/olliesaunderson/Documents/Year 3/Degree Project/prototypesite/src/Images/homeImages/JumboFeat.png")}
                alt="Jumbo Feat Image"
                width="600px"
                height="500px"/>
            </div>
          </div>
        </div>
      </Jumbotron>
    )
  }
}
export default JumboLogin;
